import "./Expenses.css";
import ExpenseItem from './E'
import ExpenseDate from "./ExpenseDate";

function Expenses() {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props[0].title}
        amount={props[0].amount}
        date={props[0].date}
      />
    </div>
  );
}

export default Expenses;
